import logo from "../img/logo2.png";
import sun from "../img/weather-icons/sun.png";
import "../App.css";
import { Link } from "react-router-dom";
import { Route } from "react-router-dom";
import Main from "../pages/Main";
import Contact from "../pages/Contact";

function Layout() {

  let exampleCity = (tab) => {
    //wykonuje zapytanie do api w funkcji
    return (
      <div id="exampleCity">
        {tab.map((item, index) => (
          <div key={index} className="App-panel2">
            <h3>{item}</h3>
            <div className="App-degree">
              <p>25&deg;C</p>
            </div>
            <div>
              <img src={sun} alt="sun" className="App-icon" />
            </div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <nav>
          <ul type="none" className="App-menu">
            <li>
              <Link to="/" className="App-nav-element">
                Home
              </Link>
            </li>
            <li>
              <a href="#search" className="App-nav-element">
                Check Weather
              </a>
            </li>
            <li>
              <Link to="/contact" className="App-nav-element">
                Contact
              </Link>
            </li>
          </ul>
        </nav>
      </header>

      <Route path="/" element={<Main />} />
      <Route path="/contact" element={<Contact />} />

      <footer></footer>
    </div>
  );
}

export default Layout;
